import React, { Component } from 'react'

import NotificationsActions from 'actions/notifications'
import SatCredentialsActions from 'actions/satCredentials'

import Ciec from './ciec'
import Fiel from './fiel'
import Csd from './csd'

// Si estamos usando este componente, no es necesario importar nada mas para que funcione,
// si solo usamos uno de los componentes parciales, sera necesario usar la accion de getSatCredentials
// en el componente padre al montar para guardar las credenciales en el store

class SatCredentials extends Component {
  componentDidMount () {
    SatCredentialsActions.getSatCredentials().catch(e =>
      NotificationsActions.error(e)
    )
  }

  render () {
    return (
      <div>
        <h1 className='subheader-green'>Accesos SAT</h1>
        <Ciec />
        <hr />
        <Fiel />
        <hr />
        <Csd />
      </div>
    )
  }
}
export default SatCredentials
